      //       console.log(arabicNum, romanObj[j])
      //       roman.push(romanObj[j].roman)
      //       arabicNum -= romanObj[j].arabic
      //     }
      //   }
      // }
    }
  }
  console.log(arabic, roman.join(''))
    output.textContent = roman.join('')
}



